const API_BASE = process.env.REACT_APP_API_BASE || process.env.REACT_APP_API_URL || '';

function setTokensAndUser({ access, refresh, user }) {
  if (access) {
    localStorage.setItem('access', access);
    localStorage.setItem('access_token', access);
  }
  if (refresh) {
    localStorage.setItem('refresh', refresh);
    localStorage.setItem('refresh_token', refresh);
  }
  if (user) {
    try { localStorage.setItem('user', JSON.stringify(user)); } catch {}
  }
}

function getToken() {
  return (
    localStorage.getItem('access') ||
    localStorage.getItem('access_token') ||
    null
  );
}

function getAuthHeader() {
  const token = getToken();
  return token ? { Authorization: `Bearer ${token}` } : {};
}

async function parseJson(res) {
  const text = await res.text();
  try { return JSON.parse(text); } catch { return text; }
}

export async function login(username, password) {
  // Ưu tiên endpoint login của users/, fallback sang token/ nếu không có
  let res = await fetch(`${API_BASE}/api/users/login/`, {
    method: 'POST',
    headers: { 'Content-Type': 'application/json' },
    body: JSON.stringify({ username, password }),
  });
  if (res.status === 404) {
    res = await fetch(`${API_BASE}/api/users/token/`, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ username, password }),
    });
  }
  const data = await parseJson(res);
  if (!res.ok) throw (typeof data === 'string' ? new Error(data) : data);

  const access = data.access ?? data.tokens?.access ?? null;
  const refresh = data.refresh ?? data.tokens?.refresh ?? null;
  const user = data.user ?? data.user_info ?? null;

  setTokensAndUser({ access, refresh, user });
  return { access, refresh, user };
}

export async function register(payload) {
  // Ưu tiên users/register/, fallback auth/register/
  let res = await fetch(`${API_BASE}/api/users/register/`, {
    method: 'POST',
    headers: { 'Content-Type': 'application/json' },
    body: JSON.stringify(payload),
  });
  if (res.status === 404) {
    res = await fetch(`${API_BASE}/api/auth/register/`, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(payload),
    });
  }
  const data = await parseJson(res);
  if (!res.ok) throw (typeof data === 'string' ? new Error(data) : data);

  const access = data.access ?? data.tokens?.access ?? null;
  const refresh = data.refresh ?? data.tokens?.refresh ?? null;
  const user = data.user ?? null;

  setTokensAndUser({ access, refresh, user });
  return { access, refresh, user };
}

export async function logout() {
  try {
    // Ưu tiên users/logout/, fallback auth/logout/
    let res = await fetch(`${API_BASE}/api/users/logout/`, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json', ...getAuthHeader() },
    });
    if (res.status === 404) {
      await fetch(`${API_BASE}/api/auth/logout/`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json', ...getAuthHeader() },
      });
    }
  } catch (e) { /* ignore */ }

  const TOKEN_KEYS = ['access', 'access_token', 'accessToken', 'token', 'jwt', 'authToken', 'refresh', 'refresh_token'];
  TOKEN_KEYS.forEach(k => localStorage.removeItem(k));
  localStorage.removeItem('user');

  // Clear session cookies (nếu có)
  document.cookie.split(";").forEach(c => {
    document.cookie = c.replace(/^ +/, "").replace(/=.*/, "=;expires=" + new Date(0).toUTCString() + ";path=/");
  });

  // phát sự kiện user -> null
  window.dispatchEvent(new CustomEvent('auth:changed', { detail: { user: null } }));
}

export async function getCurrentUser() {
  const res = await fetch(`${API_BASE}/api/users/me/`, {
    headers: { 'Content-Type': 'application/json', ...getAuthHeader() },
  });
  if (res.status === 401 || res.status === 403) throw new Error('Unauthorized');
  const data = await parseJson(res);
  if (!res.ok) throw (typeof data === 'string' ? new Error(data) : data);
  return data.user ?? data;
}

export default { login, register, logout, getCurrentUser };
